import React from 'react';

const Contact = () => {
  return (
    <div style={{ backgroundColor: '#004d40', height: '100vh', color: 'white', padding: '20px', textAlign: 'center' }}>
      <h1 style={{ fontSize: '36px', marginBottom: '10px' }}>Contact Us</h1>
      <p style={{ fontSize: '18px', marginBottom: '20px' }}>
        For more information or support, please contact us at:
      </p>
      <p style={{ fontSize: '20px', fontWeight: 'bold', marginBottom: '30px' }}>
        email@example.com
      </p>
      <Link to="/">
        <button
          style={{
            padding: '15px 30px',
            fontSize: '18px',
            backgroundColor: '#00796b',
            color: 'white',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
            transition: 'background-color 0.3s',
          }}
          onMouseOver={(e) => e.currentTarget.style.backgroundColor = '#004d40'}
          onMouseOut={(e) => e.currentTarget.style.backgroundColor = '#00796b'}
        >
          Go Back Home
        </button>
      </Link>
    </div>
  );
};

export default Contact;
